import React from 'react';

function Navbar() {
  return (
    <nav style={{ backgroundColor: 'lightblue', padding: '10px' }}>
      <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between' }}>
        <h1 style={{ margin: 0, color: 'black' }}>Library Management Systems</h1>
        <div>
          <a href="/addAuthor" className="nav-link">Add author</a>
          <a href="/showBooks" className="nav-link">Book list</a>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
